import React from 'react';

const Welcome = () => {
    return(
        <div className='home-wrapper'>
            <div className='content-wrapper'>
                <div className='h1'>Welcome to the Ado Experience</div>
                <p>You currently have <span>NO</span> Subscriptions</p>
                <p>First take a diagnostic test to determine the right course for you.</p>
                <button className='btn-go'></button>
            </div>
        </div>
    )
}

export default Welcome;
